import {React, useEffect, useState} from "react";

const SearchBar = (props)=>{

    return (
        <div className="main">
            <h1>Search Country</h1>
            <div className="search">
                <input
                value={props.search}
                id="searchBar"
                placeholder="search country"
                onChange={e=> props.setSearch(e.target.value)}
                fullWidth
                label="Search"
                />
            </div>
        </div>
    );
}
export {SearchBar};
